import React from "react";
import { Navigate, useParams } from "react-router-dom";

import "./Item.css";

const Item = ({items}) => {
  let {itemId} = useParams();  
  if (!itemId) {
    return <Navigate to="/"/>;
  }

  const item = items.find((i) => i.id === +itemId);
  if (item === undefined) {
    return (
      <div>
        <h1>Error: No item found with id {itemId}</h1>
      </div>
    );
  }
  return (    
    <div>
      <h1>Rendering item page</h1>
    </div>
  );
};

export default Item;
